    const projectTitle = this.getSubmorphNamed('project title');
    projectTitle.fontColor = Color.rgb(66, 73, 73);
    if (projectTitle.textBounds().containsPoint(evt.positionIn(projectTitle))) { this.openComponentWorld(); }
